INSERT INTO `question2` VALUES ('11', 'S1-AP协议使用在（）接口之上。', 'S1-MME', '', '', '', '', '', '', '填空', '2016年LTE中高级网优考试最新题库');
INSERT INTO `question2` VALUES ('12', 'LTE扁平网络架构是什么？', 'LTE的接入网E-UTRAN由eNodeB组成，提供用户面和控制面；LTE的核心网EPC(Evolved Packet Core)由MME，S-GW和P-GW组成；eNodeB间通过X2接口相互连接，支持数据和信令的直接传输；S1接口连接eNodeB与核心网EPC。其中，S1-MME是eNodeB连接MME的控制面接口，S1-U是eNodeB连接S-GW 的用户面接口', null, null, null, null, null, null, '论述实操', '2016年LTE中高级网优考试最新题库');
INSERT INTO `question2` VALUES ('30', '如何通过OMC修改小区的时隙配比？', '上机操作：1、第一步：进入华为OMC操作界面，然后点击拓扑管理。（5分）2、第二步：右键选中的小区，鼠标选中MML。（5分）3、第三步：在MML命令框中输入MOD CELL->小区双工模式:CELL_TDD(TDD)->红色：上下行子帧配比、特殊子帧配比。（5分）', null, null, null, null, null, null, '论述实操', '2016年LTE中高级网优考试最新题库');
INSERT INTO `question2` VALUES ('31', 'LTE的切换种类', '根据切换触发的原因，LTE的切换可分为：基于覆盖的切换、基于负载的切换和基于业务的切换。根据切换间小区频点不同与小区系统属性不同，可以分为：同频切换、异频切换、异系统切换', null, null, null, null, null, null, '论述实操', '2016年LTE中高级网优考试最新题库');
INSERT INTO `question2` VALUES ('32', 'TDD LTE无线帧格式是什么样的?', 'TDD LTE帧结构为Type2，每个10ms无线帧被分为2个5ms的半帧，每个半帧由4个数据子帧和一个特殊子帧组成。特殊子帧包括三个时隙：DwPTS、GP和UpPTS，总长1ms。', null, null, null, null, null, null, '论述实操', '2016年LTE中高级网优考试最新题库');
INSERT INTO `question2` VALUES ('33', '衡量LTE覆盖和信号质量基本测量量是什么？', 'RSRP主要用来衡量下行参考信号的功率；RSRQ主要衡量下行特定小区参考信号的接收质量；RSSI指的是手机接收到的总功率，包括有用信号、干扰和底噪，和UMTS中的RSSI概念是一致的；SINR也就是信号干扰噪声比', null, null, null, null, null, null, '论述实操', '2016年LTE中高级网优考试最新题库');
INSERT INTO `question2` VALUES ('34', '随机接入的目的', 'UE通过接入过程获得时间同步,保证数据发送在系统接收窗口内;并获取UE标识系统进行接纳控制', null, null, null, null, null, null, '论述实操', '2016年LTE中高级网优考试最新题库');
